import React from "react";
import DraftOverview from "./DraftOverview.js";

export default class Draft extends React.Component {
    constructor(props) {
        super(props);

        this.players = [];
        this.teams = [];

        this.state = {
            round: 1,
            pick: 1,
            teamId: 1
        };  
    }

    render() {
        return(
            <div>
                <DraftOverview />
            </div>

        )
    }
}
